import React from 'react';
//import ReactDOM from 'react-dom';
//import App from './App';
import { TaskListProvider } from './Contexts/taskListContext';
import { DeleteProvider } from './Contexts/deleteContext';

ReactDOM.render(
    <TaskListProvider>
        <DeleteProvider>
            <App />
        </DeleteProvider>
    </TaskListProvider>,
    document.getElementById('root')
);
reportWebVitals();
